INSERT INTO `posts` (`id`, `author`, `title`, `content`, `created_at`, `updated_at`, `postPic`) VALUES
(1, 'Norbert Kytka', 'WAS IST BIG DATA?', 'In der Vergangenheit waren gesammelte Daten in der Regel strukturiert und übersichtlich. Beispielsweise Einträge in eine Kundenakte mit Name, Adresse und Alter des Kunden. Diese Datenmengen konnten vergleichsweise einfach ausgewertet werden, um etwa das Durchschnittsalter des Kundenstamms zu ermitteln. Durch den zunehmenden Gebrauch von Technik und der fortschreitenden Digitalisierung hat sich dieses Verhalten verändert. Über verschiedenste Touchpoints (Onlineshop, Social Media oder Fertigungsprozesse) werden große Mengen an Daten (volume) generiert. Diese werden in einer immer größer werdender Geschwindigkeit (velocity) gesammelt, transferiert und gespeichert Dabei kommen die Datensätze in verschiedensten Formen (variaty) z. B. als Bilder, Töne, Videos oder Texte vor.  Die Folge ist eine große, komplexe, schnelllebige und schwach strukturierte Masse an Daten. Diese kann aufgrund ihrer Eigenschaften nicht mit herkömmlichen Datenverarbeitungsmethoden ausgewertet werden und wird als Big Data bezeichnet. Der Begriff Big Data wurde dabei schon 2001 durch das 3V Modell, bestehend aus volume, velocity und variety, definiert. Heutzutage umfasst die Bezeichnung außerdem den Einsatz von Technologie, um die Datenmenge zu analysieren, aufzubereiten und nutzbar zu machen. Außerdem wird der Datensatz auf seine Korrektheit geprüft. Das Modell kann daher um die Begriffe Nutzen (value) und Korrektheit (validity) erweitert werden. Welche Vorteile bringt Big Data? Bereits die Analyse von wenigen, strukturierten Daten wie die Einträge in eine Kundenakte konnten einem Unternehmen erhebliche Vorteile liefern. So konnten sie damit z. B. wichtige Erkenntnisse über die Zielgruppe des Unternehmens gewinnen. Heute ist die Sammlung, Verarbeitung und Aufbereitung von unstrukturierten Datenmengen in Dimensionen von Terabyte (1000 Gigabyte) oder sogar Petabyte (1000 Terabyte)  möglich. Dadurch können bisher nie dagewesen Möglichkeiten erschlossen werden. So lassen sich unter anderem Verbesserungspotentiale in Geschäftsprozessen aufdecken und Produktentwicklungs- sowie Marketing- oder Vertriebsaktivitäten effizienter gestalteten. Darüber hinaus ist es möglich, Entscheidungen auf Basis realer Fakten erfolgsversprechender und schneller zu treffen. Mit den passenden Rahmenbedingungen können außerdem Maschinen dazu befähigt werden, sich durch die gesammelten Daten eigenständig einen Erfahrungsschatz anzueignen. Dieser kann anschließend auf künftige Problemstellungen angewendet werden (vergleiche Machine Learning). Big Data kann für Unternehmen so in Zukunft ein zentraler Wettbewerbsvorteil sein. Big Data in SAP:Die SAP bietet u.a. durch ihre SAP Cloud Plattform, SAP HANA und der SAP HANA Data Management Suite Big Data Lösungen an. Daten können damit aus verschiedensten Quellen eingelesen, gespeichert und in Höchstgeschwindigkeit verarbeitet und analysiert werden. Damit ermöglichen die SAP-Lösungen ihren Anwendern, Big Data verwertbar und nutzbar zu machen.Big Data in SAP: Die SAP bietet u.a. durch ihre SAP Cloud Plattform, SAP HANA und der SAP HANA Data Management Suite Big Data Lösungen an. Daten können damit aus verschiedensten Quellen eingelesen, gespeichert und in Höchstgeschwindigkeit verarbeitet und analysiert werden. Damit ermöglichen die SAP-Lösungen ihren Anwendern, Big Data verwertbar und nutzbar zu machen.', '2022-07-05 08:53:03', '2022-07-05 08:53:03', );
INSERT INTO `posts` (`id`, `author`, `title`, `content`, `created_at`, `updated_at`, `postPic`) VALUES
(3, 'Prof. Dr. Manfred, Spitzer Universität Ulm, Abteilung für Psychiatrie', 'DER WERT UNSERER DATEN', 'Daten sind das Gold des 21. Jahrhunderts – so zumindest hört und liest man es sehr oft in ökonomischen Beiträgen zur Digitalisierung wirtschaftlicher Prozesse. Je mehr Daten generiert werden und je wichtiger wir sie nehmen, erhalten auch politische Entscheidungen zum Verhältnis von Nutzung bzw. Auswertung und damit auch von Monetarisierung unserer Daten einerseits und deren Privatheit und Schutz andererseits eine immer größere Bedeutung. Um hier richtig zu entscheiden, bräuchte man eigentlich Kosten-Nutzen-Analysen, die es jedoch ganz einfach nicht gibt. Was es auf jeden Fall gibt, ist jedoch – wahrscheinlich hierzulande weltweit am deutlichsten – ein großes Unbehagen im Hinblick auf den Zugang von Unternehmen und staatlichen Institutionen zu personenbezogenen bzw. persönlichen Daten. \r\nJeffrey Prince vom Department of Business Economics and Public Policy an der Indiana University und Scott Wallsten vom Technology Policy Institute in Washington, DC, publizierten im Januar 2020 eine Studie, im Rahmen derer gemessen wurde, wie viel US$1 verschiedene Typen von Daten (über Finanzen, Biometrie, Standort, Netzwerke, Kommunikation und Web-Nutzung), die von verschiedenen Institutionen gesammelt werden, den Menschen aus verschiedenen Ländern (USA, Mexiko, Brasilien, Kolumbien, Argentinien und Deutschland) jeweils ganz konkret wert sind. Man kann diese Frage auf 2 Arten stellen: ▪ „Wie viel würden Sie verlangen, um Ihre Daten preiszugeben?“ und ▪ „Wie viel würden Sie bezahlen, damit Ihre Daten nicht preisgegeben werden?“ Man spricht im ersten Fall von „willingness to accept (WTA)“ und im zweiten Fall von „willingness to pay“ (WTP). Im Durchschnitt aller Länder und Plattformen legten die Menschen den größten Wert auf die Geheimhaltung von Finanzdaten, biometrischen (Fingerabdruck-) Informationen und von ihnen produzierten Texten.', '2022-07-05 12:49:01', '2022-07-05 12:49:01', );
INSERT INTO `posts` (`id`, `author`, `title`, `content`, `created_at`, `updated_at`, `postPic`) VALUES
(4, 'Carsten Orwat', 'BIG DATA UND DIE GESELLSCHAFTLICHEN FOLGEN', 'Die Erzeugung, Verknüpfung und Auswertung großer Datenmengen, oft mit dem Begriff „Big Data“ verbunden, beeinflusst in unserer modernen, digitalisierten Gesellschaft beinahe alle Lebensbereiche. Vernetzte Computertechnologie, Smartphones, soziale Netzwerke, vielfältige Online-Angebote und die Durchdringung des Alltags mit dem „Internet der Dinge“ führen zu einer rasanten Vervielfachung von Datenquellen und Datenmengen. Neben den Potenzialen von Big Data, z. B. in den Bereichen Wirtschaft oder Medizin, werden zunehmend auch die gesellschaftlichen Herausforderungen deutlich. Es ergeben sich insbesondere Fragen zu kommerzieller und staatlicher Überwachung, informationeller Selbstbestimmung, Schutz der Privatsphäre, Transparenz bei den Verfahren der Datenverarbeitung oder zu Fehlern bei Datenverwendungen sowie automatisierten Entscheidungen. Das Projekt ABIDA (Assessing Big Data – Begleitforschung Big Data) verfolgt das Ziel, Wissen aus gesellschaftlicher Perspektive über Entwicklungen, Herausforderungen und Handlungsoptionen von Big Data zusammenzubringen, zu erzeugen, zu vertiefen und zu verbreiten.', '2022-07-05 12:54:06', '2022-07-05 12:54:06', );
INSERT INTO `posts` (`id`, `author`, `title`, `content`, `created_at`, `updated_at`, `postPic`) VALUES
(5, 'Sara Schnierle', 'DIE ZUKUNFT VON UNTERNEHMEN LIEGT IN DER ANALYSE VON BIG DATA', 'Letztendlich gibt es in einer Welt, in der Erfahrung der Schlüssel zum Erfolg ist und in der Unternehmen ständig um Alleinstellungsmerkmale kämpfen, nichts Wertvolleres als Daten. Big Data liefert Unternehmen den Datenumfang und die Erkenntnisse, die sie benötigen, um einen realistischen Wachstumsplan zu entwickeln. Mit den richtigen Analysen und Tools in der Cloud können Sie mit Big Data all Ihre Ziele erreichen. \r\nDie richtigen Big-Data-Technologien werden Ihnen aufzeigen, wie Sie Ihre Kundenbeziehungen vertiefen und was Sie tun können, um die Effizienz Ihres Teams zu erhöhen. Datenerfassungssysteme ermöglichen es Ihnen außerdem, Ihre Geschäftsabläufe zu optimieren, Ihre Ausgaben zu senken und gleichzeitig Ihren Gewinn zu steigern. In den kommenden Jahren werden Unternehmen, die sich Big Data nicht zunutze machen, endlose Möglichkeiten entgehen.', '2022-07-05 13:05:18', '2022-07-05 13:05:18', );

